<template>
  <div class="wrap">
    <div class="alert alert-info">
        {{ log }}
    </div>
    <div class="container form">
    <br />
    <form method="post" @submit.prevent="addComponent">
     <svg class="mb-4" width="243" height="80" viewBox="0 0 243 80" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect width="243" height="80" fill="url(#pattern0)"/>
                <defs>
                <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                <use xlink:href="#image0_105_2821" transform="translate(0 -0.00392348) scale(0.000919118 0.00279182)"/>
                </pattern>
                <image id="image0_105_2821" width="1088" height="361" xlink:href="data:image/png;base64,"/>
      </defs>
     </svg>
    <h4 class="h3 mb-3 font-weight-normal">Введите QR-код бэкплейна</h4>

    <input
        type="text"
        placeholder="QR-код"
        v-model="formData.qrcode"
        class="form-control"
    />
    <br />
    <button type="submit" class="btn btn-primary">
        Добавить
    </button>
    </form>
    </div>
  </div>
</template>

<script>
    import axios from "axios";
export default {
  data() {
    return {
      formData: {
        qrcode: ""
      },
      logs: [],
      log: []
    };
  },
  props: {
    id: {
      type: [Number, String],
      required: true,
    },
  },
  methods: {
    addComponent() {
      axios
        .post(`http://185.129.98.66:5000/app/add_disk_basket4/${this.id}/`, this.formData)
        .then((response) => {
          console.log(response);
          if (response.data.error == '500') {
            this.logs = response.data.error;
            this.log = "Компонент не найден в базе!"
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else if (response.data.error == '505') {
            this.logs = response.data.error;
            this.log = "Компонент числится, как забракованный!"
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else if (response.data.error == '510') {
            this.logs = response.data.error;
            this.log = "Компонент, который должен был пройти проверку, не помечен, как прошедший!"
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else if (response.data.error == '515') {
            this.logs = response.data.error;
            this.log = "Компонент уже числится в составе другого сервера c QR-кодом: " + response.data.other;
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else if (response.data.error == '520') {
            this.logs = response.data.error;
            this.log = "Введите qr-code компонента!";
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else if (response.data.error == '525') {
            this.logs = response.data.error;
            this.log = "Компонент уже числится в составе этого же сервера!";
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else if (response.data.error == '530') {
            this.logs = response.data.error;
            this.log = "Компонент данного типа уже установлен в нужном количестве (лишнее сканирование)!";
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else if (response.data.error == '535') {
            this.logs = response.data.error;
            this.log = "Компонент не является объединительным модулем!";
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
          }
          else {
            this.logs = response.data.other;
            this.log = "Компонент успешно добавлен!"
            alert = document.getElementsByClassName('alert');
            alert[0].style.display = 'block';
            this.$router.push({ name: "AddServer", params: { id: this.id } });
          }
        })
        .catch((error) => {
          console.log(error, error.response);
        });
    },
  },
};
</script>
<style>
.form {
  margin-top: 5rem;
}
.alert {
    display: none;
}
</style>